                    var azureFunctionURI = new Uri("https://jbrl-bot.azurewebsites.net/api/XBRLRestoreReport?code=/YZp9LQ9E6wlMAVzVD5CiRHNG1DKD/hY7yCtENzuraYlXLfCfVmENQ==");
